import "../estilos/testimonio.css";  




function Testimonios(props) {
    return(<div className="testimonio-container">
        <img src={require(`../imagenes/${props.foto}.png`)} alt="foto emma" />
        <h1>
<p>hola{props.nombre}</p>
<p>{props.edad}</p>
<p></p>

        </h1>
    </div>)
    
}
export default Testimonios
